import React from 'react';
import { Link } from 'react-router-dom';
import HeroCarousel from '../components/HeroCarousel';
import './Service.css';

const Service = () => {
  const services = [
    {
      id: 1,
      title: 'Photo Shoot',
      listings: '2D Listing',
      image: '/assets/vehicles/polaris-rzr1000.jpg',
      description: 'Professional photography services for your adventure'
    },
    {
      id: 2,
      title: 'Tour Guide',
      listings: '22 Listing',
      image: '/assets/vehicles/canam-maverick-turbo.jpg',
      description: 'Expert guides for the best adventure experience'
    },
    {
      id: 3,
      title: 'Cozy Event',
      listings: '23 Listing',
      image: '/assets/vehicles/polaris-rzr1000-4seater.jpg',
      description: 'Organize memorable events in beautiful locations'
    },
    {
      id: 4,
      title: 'Interesting Rest',
      listings: '24 Listing',
      image: '/assets/vehicles/dirt-bike.jpg',
      description: 'Relax and unwind in stunning destinations'
    }
  ];

  return (
    <div className="service-page">
      <HeroCarousel title="Our Amazing Services" subtitle="Services We Offer" />

      <div className="service-content">
        <div className="container">
          <div className="services-grid">
            {services.map((service) => (
              <div key={service.id} className="service-card">
                <div className="service-image">
                  <img src={service.image} alt={service.title} />
                </div>
                <div className="service-info">
                  <h3>{service.title}</h3>
                  <p className="service-listings">{service.listings}</p>
                  <p className="service-description">{service.description}</p>
                  <Link to="/destination" className="btn btn-service">
                    Book Now â†’
                  </Link>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Service;
